!function(){var e=angular.module("ngFadeImgLoading",[]);e.directive("fadeImgLoading",function(){return{scope:{image:"@",blur:"@"},template:"<img id='blur' class='blur' ng-src=\"{{blur}}\">				<img id='image' class='img-hide' ng-src=\"{{image}}\">",link:function(e,i,n){var a=angular.element(i[0].children.blur),l=angular.element(i[0].children.image);l.on("load",function(){a.addClass("img-hide"),l.removeClass("img-hide"),l.addClass("img-show")}).on("error",function(){})}}})}();